import React, { Component } from 'react'

class Create extends Component {
    state={
        event :[
        {'id':1001,'eventName':'Birthday party','Date':'12/03.2021'},
        {'id':1002,'eventName':'EBM party','Date':'03/07.2021'},
    ]}
    render() {
        return (
            <div>
                <table>
                    <ol>
                        {this.state.event.id}
                    </ol>
                </table>
            </div>
        )
    }
}
export default Create;
